import Abilities from './Abilities'

const Pokemon = ({ pokemon }) => {
    const abilities = pokemon.abilities.map((ability, i) => <li className="capitalize" key={i}>{ability.ability.name}</li>)


    return (
        <div>
            <Abilities abilities={abilities} />
        </div>
    )
}

export default Pokemon
